import React from "react";

const Analysis = () => {
  return (
    <div className="Analysis">
      <div>
        <h1>Analysis</h1>
        <p>
          This is your user dashboard where you can manage your account settings
          and view your trading activity.
        </p>
      </div>
    </div>
  );
};

export default Analysis;
